import React from 'react';
import './Circle.css';

const Big_circle = () => {
  return (
    <div className = "Big_circle">
      // <img src = ""/>
      <svg viewBox="0 0 40 35" xmlns="http://www.w3.org/2000/svg" class="svg_big_circle">
              <circle cx="20" cy="15" r="20" />
            </svg>
    </div>
  );
}

const Circle = () => {
  return (
    <div className = "Circle">


    </div>
  );
}

export default Circle;
